import React from 'react';
import Item from './Item';

export default function Items({ items, onAdd }) {
  return (
    <main>
      <h2 style={{ display: 'block' }}>Каталог</h2>
      {items.map((el) => (
        <Item key={el.id} item={el} onAdd={onAdd} />
      ))}
    </main>
  );
}
